import React,{ Component } from 'react'
import './css/ElysianContentHeader.css'

class ElysianContentHeader extends Component{
    render(){
        return(
            <div className="ElysianContentHeader">
                {
                    this.props.Title
                }
            </div>
        )
    }
}

export default ElysianContentHeader
